import React, { Component } from "react";
import ReactDOM from "react-dom";
import Iframe from 'react-iframe'


class MarineTrafficMap extends Component {
    componentDidMount() {
        const script = document.createElement("script");
        script.async = true;
        script.src = <script type="text/javascript" src="http://www.marinetraffic.com/js/embed.js"></script>;
        script.onload = () => this.scriptLoaded();
        document.body.appendChild(script);
    }
    render() {
        return (
            <div>
                <Iframe src="http://www.marinetraffic.com/js/embed.js"
                    width="450px"
                    height="450px"
                    id="myId"
                    className="myClassname"
                    display="initial"
                    position="relative"
                     />

                {/* <iframe src="https://www.marinetraffic.com/en/ais/home/centerx:-12.0/centery:25.0/zoom:4" width="100%" height="450" frameborder="0" style={{ border: 0 }} allowfullscreen="" aria-hidden="false" tabindex="0"></iframe> */}
            </div>
        );
    }
}

export default MarineTrafficMap;
